var destination = {
	position: {
			lat: 31.2304,
			lng: 121.4737
		},
	action_string: "to eat dumplings overlooking the shanghai skyline",
	name: "Shanghai, China",
	key: "2YqzgZoM"
}


var url = "http://free.rome2rio.com/api/1.4/json/Search?";


function runner(long,lati) {

	//get the response with given long lat:
	var data = {
		key: destination.key,
		dPos: destination.position,
		oPos: {
			lat: lati,
			lng: long
		}
	};

	console.log('cheese');
	var response;
	$.getJSON(url, data, function (data, status) {
		console.log("status is : " + status);
  		if (status === "success") {
  			response=data;
  			//console.log('this is data' + data);
 		}
	});





	var route=response.routes[0];

	var price=route.indicativePrices[0].price;

	var distance=route.distance;

	var hours = Math.floor(route.totalDuration/60); // TODO take the floor.
	var minutes=route.totalDuration%60;

	//let's work out vehicle stuff.

	var segments=route.segments;

	//list of vehicles
	var vehicles_dict=response.vehicles;

	//primitive map of vehicle index to cardinality.
	var our_vehicles=[];

	//name of vehicle to number map
	var our_vehicles_hash={};

	//work out how many of each form of transportation we take.
	//for some reason, for-each loop didn't work, so back to normal.
	for (var i=0; i<segments.length;i++) {
		vehicle_type = segments[i].vehicle;
		if (!our_vehicles[vehicle_type]) our_vehicles[vehicle_type]=1;
		else our_vehicles[vehicle_type]=our_vehicles[vehicle_type]+1;
	}

	//construct our_vehicles_hash
	for (var i=0; i<our_vehicles.length; i++) if (our_vehicles[i]) our_vehicles_hash[vehicles_dict[i].name]=our_vehicles[i];

	var vehicle_string="";
	for (var vehicle in our_vehicles_hash) {
		if (our_vehicles_hash.hasOwnProperty(vehicle)) {
			vehicle_string+=our_vehicles_hash[vehicle];
			vehicle_string+=' ';
			//TODO take into account plural. I think there's an API for that.
			vehicle_string+=vehicle;
			vehicle_string+=', ';
		}
	}

	//console.log(vehicle_string);

	var query = "Would you travel " + distance + " km,  taking " +hours + " hrs, " + minutes + " min, on a total of " + vehicle_string + destination.action_string;

	console.log(query);


	//cool, that basically works. now what?

	//first response should be done based on long/lat of user, and then lat/long of whatever the destination is.
}


